import React from 'react';
import {Link} from 'react-router-dom';
import {Box, Grommet,Button} from 'grommet';
import './App.css';


function App() {
  const name="Aaakarsh";
  return (
    <Grommet full>

        <Box fill={true}  overflow="scroll" wrap justify="center"  align="center" background={{repeat:"no-repeat",color:"dark-1"}} >
          <Box >
              <Button primary size="large"> Login </Button>
          </Box>
        <Box>
              <Link to={`/Home/${name}`} >Home</Link>
          </Box>
          <Box >
            <h1>welcome</h1>
            </Box>
        </Box>

      </Grommet>
  );
}

export default App;
